import React from 'react';
import { Col, Container, Row } from 'react-bootstrap';

function Teams() {
  const getTeamByLeague = (data) => {
    let teamByLeague = {};
    data.forEach((element) => {
      if (teamByLeague.hasOwnProperty(element.league)) {
        teamByLeague[element.league].push(element);
      } else {
        teamByLeague[element.league] = [element];
      }
    });
    return teamByLeague;
  };
  const teamsData = [
    {
      name: 'Exodus',
      branding: {
        primary: '',
        secondary: '',
        logo: '',
      },
      league: 'Flux Cup',
      season: 1,
    },
    {
      name: 'Volcanic',
      branding: {
        primary: '',
        secondary: '',
        logo: '',
      },
      league: 'Flux Cup',
      season: 1,
    },
    {
      name: 'Soar Academy',
      branding: {
        primary: '',
        secondary: '',
        logo: '',
      },
      league: 'Flux Cup',
      season: 1,
    },
  ];

  return (
    <Container className='gen-page text-light' fluid>
      <Container>
        <Row>
          <Col className='p-3' md={12}>
            <center>
              <h1>Teams</h1>
              <h3>View Teams and their players below!</h3>
            </center>
          </Col>
        </Row>
        <Row>
          <div className='g-2'>
            {Object.entries(getTeamByLeague(teamsData)).map(([key, value]) => {
              return (
                <Row>
                  <h1>{key}</h1>
                  {value.map((e) => (
                    <Col md={4}>
                      <center>{`${e.name} | ${e.season}`}</center>
                    </Col>
                  ))}
                </Row>
              );
            })}
          </div>
        </Row>
      </Container>
    </Container>
  );
}

export default Teams;
